import React, { useState } from 'react';

const SideBar = () => {
	const [isOpen, setIsOpen] = useState(false);

	const toggleSidebar = () => {
		setIsOpen(!isOpen);
	};

	return (
		<div className={`min-h-screen bg-transparent sidebar ${isOpen ? 'w-32' : 'w-2'}`}>
			<p onClick={toggleSidebar}>hello</p>
		</div>
	);
};

export default SideBar;
